INSERT INTO `cond` (`cnid`, `name`, `strsql`, `pgcache`, `flgt`, `cdate`, `udate`, `muid`) VALUES
(1, '管理者', 'SELECT divs as div1,id as uid,muid,pw,name,flg,permitted,email,permitted_column,pwmisscount,pdate from musr where muid is not null and email is not null and email <> ''''', NULL, NULL, NULL, NULL, 2),
(8, '本人(多言語フラグが0)', 'SELECT * FROM usr WHERE mflag = 1 and lang_flag = 0', NULL, NULL, NULL, NULL, NULL),
(9, '本人(多言語フラグが1)', 'SELECT * FROM usr WHERE mflag = 1 and lang_flag = 1', NULL, NULL, NULL, NULL, NULL),
(10, '本人', 'SELECT * FROM usr WHERE mflag = 1', NULL, NULL, NULL, NULL, 2),
(11, '上司', 'SELECT * FROM usr WHERE serial_no in(select B.serial_no from usr_relation REL join usr A on A.uid = REL.uid_a join usr B on B.uid = REL.uid_b where REL.user_type = 1 and A.mflag = 1)', NULL, NULL, NULL, NULL, 2),
(12, '部下', 'SELECT * FROM usr WHERE serial_no in(select B.serial_no from usr_relation REL join usr A on A.uid = REL.uid_a join usr B on B.uid = REL.uid_b where REL.user_type = 2 and A.mflag = 1)', NULL, NULL, NULL, NULL, 2),
(13, '同僚', 'SELECT * FROM usr WHERE serial_no in(select B.serial_no from usr_relation REL join usr A on A.uid = REL.uid_a join usr B on B.uid = REL.uid_b where REL.user_type = 3 and A.mflag = 1)', NULL, NULL, NULL, NULL, 2),
(15, '本人+上司+部下+同僚', 'SELECT * FROM usr WHERE serial_no in(select B.serial_no from usr_relation REL join usr A on A.uid = REL.uid_a join usr B on B.uid = REL.uid_b where A.mflag = 1 and user_type<4 ) or mflag = 1', NULL, NULL, NULL, NULL, 2),
(19, '選定が確定済みの本人', 'SELECT * FROM usr WHERE mflag = 1 AND select_status = 2', NULL, NULL, NULL, NULL, 2),
(20, 'まだ承認依頼をしていない本人', 'select * from usr where mflag = 1 and select_status = 0', NULL, NULL, NULL, NULL, 2),
(21, 'まだ承認依頼をしていない本人(多言語フラグが0)', 'select * from usr where mflag = 1 and select_status = 0 and lang_flag = 0', NULL, NULL, NULL, NULL, 2),
(22, 'まだ承認していない承認者', 'select * from usr where uid in(select uid_b from usr A left join usr_relation B on A.uid = B.uid_a and B.user_type = 51  where A.mflag = 1 and A.select_status = 1)', NULL, NULL, NULL, NULL, 2),
(23, 'まだ1件も承認していない承認者', 'select * from usr where uid in (select uid_b from usr A left join usr_relation B on A.uid = B.uid_a and B.user_type = 51 WHERE A.mflag = 1 and A.select_status = 1 and uid_b is not null)\nand uid not in (select uid_b from usr A left join usr_relation B on A.uid = B.uid_a and B.user_type = 51 WHERE A.mflag = 1 and A.select_status = 2 and uid_b is not null)', NULL, NULL, NULL, NULL, NULL),
(24, '対象者ではない承認者', 'select * from usr where uid in(select uid_b from usr A left join usr_relation B on A.uid = B.uid_a and B.user_type = 51 where A.mflag = 1) AND mflag != 1', NULL, NULL, NULL, NULL, 2),
(25, '対象者の選定ステータスが"確定済み"でない承認者', 'select * from usr where uid in(select uid_b from usr A left join usr_relation B on A.uid = B.uid_a and B.user_type = 51  where A.mflag = 1 and A.select_status in (0,1))', NULL, NULL, NULL, NULL, 2),
(30, '評価を完了していない本人', 'SELECT * FROM usr WHERE serial_no in(SELECT A.serial_no FROM usr A LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 0 WHERE A.mflag = 1 and (B.answer_state <> 0 or B.answer_state is null))', NULL, NULL, NULL, NULL, 2),
(31, '評価を完了していない上司', 'SELECT * FROM usr WHERE serial_no in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 1 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 1 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 1 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null))', NULL, NULL, NULL, NULL, 2),
(32, '評価を完了していない部下', 'SELECT * FROM usr WHERE serial_no in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 2 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 2 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 2 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null))', NULL, NULL, NULL, NULL, 2),
(33, '評価を完了していない同僚', 'SELECT * FROM usr WHERE serial_no in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 3 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 3 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 3 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null))', NULL, NULL, NULL, NULL, 2),
(34, '評価を完了していない(他者)', 'SELECT * FROM usr WHERE serial_no in(\r\nSELECT A.serial_no FROM usr_relation C\r\nLEFT JOIN user_type U ON C.user_type = U.user_type_id\r\nLEFT JOIN usr D ON C.uid_a = D.uid\r\nLEFT JOIN usr A ON C.uid_b = A.uid\r\nLEFT JOIN event_data B ON A.serial_no = B.serial_no AND D.serial_no = B.target\r\nWHERE D.mflag = 1 AND (answer_state <> 0 or answer_state is null) AND U.utype = 1\r\n)', NULL, NULL, NULL, NULL, 2),
(35, '評価を完了していない(本人+上司+部下+同僚)', 'SELECT * FROM usr WHERE (serial_no in(SELECT A.serial_no FROM usr A LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 0 WHERE A.mflag = 1 and (B.answer_state <> 0 or B.answer_state is null))\nor\nserial_no in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 1 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 1 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 1 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null))\nor\nserial_no in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 2 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 2 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 2 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null))\nor\nserial_no in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 3 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 3 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 3 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null)))\n', NULL, NULL, NULL, NULL, 2),
(36, '1件も評価を完了していない(本人+上司+部下+同僚)', 'SELECT * FROM usr WHERE \n(\n	serial_no in(SELECT A.serial_no FROM usr A LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 0 WHERE A.mflag = 1 and (B.answer_state <> 0 or B.answer_state is null))\n	or\n	serial_no in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 1 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 1 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 1 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null))\n	or\n	serial_no in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 2 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 2 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 2 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null))\n	or\n	serial_no in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 3 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 3 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 3 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null))\n)\nand\nserial_no not in(SELECT A.serial_no FROM usr A LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 0 WHERE A.mflag = 1 and B.answer_state = 0)\nand\nserial_no not in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 1 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 1 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 1 and D.serial_no = B.target WHERE D.mflag = 1 and B.answer_state = 0)\nand\nserial_no not in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 2 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 2 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 2 and D.serial_no = B.target WHERE D.mflag = 1 and B.answer_state = 0)\nand\nserial_no not in(SELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 3 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 3 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 3 and D.serial_no = B.target WHERE D.mflag = 1 and B.answer_state = 0)\n', NULL, NULL, NULL, NULL, NULL),
(38, '全ての評価を完了した(本人＋上司＋部下＋同僚)', 'SELECT * FROM usr WHERE (serial_no IN(SELECT B.serial_no FROM usr_relation REL JOIN usr B ON B.uid = REL.uid_b WHERE user_type<4 ) OR mflag = 1)\n\nAND\n\nserial_no NOT IN(\n\nSELECT A.serial_no FROM usr A LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 0 WHERE A.mflag = 1 and (B.answer_state <> 0 or B.answer_state is null)\n\nUNION ALL\n\nSELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 1 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 1 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 1 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null)\n\nUNION ALL\n\nSELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 2 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 2 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 2 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null)\n\nUNION ALL\n\nSELECT A.serial_no FROM usr_relation C LEFT JOIN usr D ON C.uid_a = D.uid and C.user_type = 3 LEFT JOIN usr A ON C.uid_b = A.uid and C.user_type = 3 LEFT JOIN event_data B ON A.serial_no = B.serial_no and B.evid%100 = 3 and D.serial_no = B.target WHERE D.mflag = 1 and (answer_state <> 0 or answer_state is null)\n\n)', NULL, NULL, NULL, NULL, 2),
(48, '多言語フラグが0の人の参照者でサーベイ対象者ではない人', 'SELECT * FROM usr WHERE serial_no in(select B.serial_no from usr_relation REL join usr A on A.uid = REL.uid_a join usr B on B.uid = REL.uid_b where REL.user_type = 52 and A.mflag = 1 and A.lang_flag = 0) and mflag <> 1', NULL, NULL, NULL, NULL, NULL),
(49, '多言語フラグが1の人の参照者でサーベイ対象者ではない人', 'SELECT * FROM usr WHERE serial_no in(select B.serial_no from usr_relation REL join usr A on A.uid = REL.uid_a join usr B on B.uid = REL.uid_b where REL.user_type = 52 and A.mflag = 1 and A.lang_flag = 1)  and mflag <> 1', NULL, NULL, NULL, NULL, NULL),
(50, '参照者でサーベイ対象者ではない人', 'SELECT * FROM usr WHERE serial_no in(select B.serial_no from usr_relation REL join usr A on A.uid = REL.uid_a join usr B on B.uid = REL.uid_b where REL.user_type = 52 and A.mflag = 1) and mflag <> 1', NULL, NULL, NULL, NULL, 2),
(53, '参照者', 'SELECT * FROM usr WHERE serial_no in(select B.serial_no from usr_relation REL join usr A on A.uid = REL.uid_a join usr B on B.uid = REL.uid_b where REL.user_type = 52 and A.mflag = 1)', NULL, NULL, NULL, NULL, 2),
