INSERT INTO `mail_format` (`mfid`, `name`, `title`, `body`, `header`, `footer`, `file`, `cdate`, `udate`, `muid`, `title_1`, `body_1`, `title_2`, `body_2`, `title_3`, `body_3`, `title_4`, `body_4`, `mfodr`, `file_1`, `file_2`, `file_3`, `file_4`) VALUES
(1, '回答者の選定依頼', '【360度フィードバック】回答者選定のお願い', '===========================================================================<br>このメールは、「360度フィードバック」の対象者に対し送信しています。<br>このメールにはあなた個人のマイページにログインするためのID及びパスワードが記載されております。<br>記載のID及びパスワードはお１人ずつ異なりますので、<br>他の方に本メールを転送されませんようお願い申し上げます。<br>===========================================================================<br><br>%%%%name%%%%様<br><br>先日ご案内致しました「360度フィードバック」を本日より開始致します。<br>つきましては下記ＵＲＬにアクセス、ログインのうえ、回答者の選定をお願い致します。<br>必ず期間中に、回答者の確定を行って頂きますようお願い致します。<br><br><br>＜回答者選定期間＞<br>0000年00月00日（）～00月00日（）00：00<br>※　土日も含め２４時間アクセス可能です。<br><br><br>＜回答者選定方法＞<br>（１）以下のURLにアクセスして下さい。<br>%%%%URL%%%%<br><br>（２）以下のID・パスワードを入力し、マイページにログインして下さい。<br>★初回ログインの際にパスワードを変更して頂きます。<br>　 パスワードは必ずお手元に控えておいて頂くようにお願い致します。<br>-------------------------------------------<br>あなたのID: %%%%uid%%%%<br>あなたのパスワード: %%%%pw%%%%<br>-------------------------------------------<br>ID・パスワードは半角英数字です。<br>大文字・小文字も判別されますのでお間違えのないようお願い致します。<br>なお、コピーペーストでもログイン可能です。<br><br>（3）ログインすると、「回答者選定」というリンクがありますのでクリックして下さい。<br><br>（4）画面の案内に従って、「回答者の選定」及び「回答者の確定」を行って下さい。<br><br><br>ご不明な点がございましたら、以下までお問合せ下さい。<br><br><br>◆◆◆サーベイの内容に関するお問合せ先◆◆◆<br>株式会社●●●●<br>担当：<br>電話：<br>メール：', NULL, NULL, '', '2008-12-17 15:00:44', '2013-12-10 14:31:25', 2, '', '', 'パスワード再送信　簡体字', '%%%%name%%%%さんへログインの際のパスワードを再送信いたします。。。-------------------------PW: %%%%pw%%%%-------------------------', 'パスワード再送信　簡体字', '', '한글password', '', 1, '', '', '', ''),
(2, '回答者の選定依頼 リマインド1', '【重要】360度フィードバック　回答者の選定をお願い致します', '===========================================================================<br>このメールは、「360度フィードバック」の対象者のうち、<br>現時点で回答者の確定がお済みでない方に対し送信しています。<br>このメールにはあなた個人のマイページにログインするためのID及びパスワードが記載されております。<br>記載のID及びパスワードはお１人ずつ異なりますので、<br>他の方に本メールを転送されませんようお願い申し上げます。<br>===========================================================================<br><br>%%%%name%%%%様<br><br>現在ご協力をお願いしております回答者の選定につきまして、<br>まだあなたの回答者選定が完了しておりません。<br>つきましては下記ＵＲＬにアクセス、ログインのうえ選定状況をご確認頂き、<br>選定を確定して頂きますようお願い致します。<br><br>＜回答者選定期間＞<br>0000年00月00日（）～00月00日（）00：00<br>※　土日も含め２４時間アクセス可能です。<br><br><br>＜回答者選定方法＞<br>（１）以下のURLにアクセスして下さい。<br>%%%%URL%%%%<br><br>（２）以下のID・パスワードを入力し、マイページにログインしてください。<br>-------------------------------------------<br>あなたのID: %%%%uid%%%%<br>あなたのパスワード:初回ログインの場合->●月●日に配信したメールに記載されています。<br>　　　　　　　　　 2回目以降のログインの場合->初回に変更したパスワードとなります。<br>-------------------------------------------<br>ID・パスワードは半角英数字です。<br>大文字・小文字も判別されますのでお間違えのないようお願い致します。<br>なお、コピーペーストでもログイン可能です。<br><br>（3）ログインすると、「回答者選定」というリンクがあるのでクリックして下さい。<br><br>（4）画面の案内に従って、「回答者の選定」及び「回答者の確定」を行って下さい。<br><br><br>ご不明な点がございましたら、以下までお問合せ下さい。<br><br><br>◆◆◆サーベイの内容に関するお問合せ先◆◆◆<br>株式会社●●●●<br>担当：<br>電話：<br>メール：', NULL, NULL, '', '2010-04-07 09:47:38', '2013-12-10 14:31:51', 1, '', '', '', '', NULL, '', NULL, '', 2, '', NULL, NULL, NULL),
(4, '回答依頼', '【360度フィードバック】回答ご協力のお願い', '===========================================================================<br>このメールは「360度サーベイ」のご協力をお願いする方に対し送信しています。<br>このメールにはあなた個人のマイページにログインするためのID及びパスワードが記載されております。<br>記載のID及びパスワードはお１人ずつ異なりますので、<br>他の方に本メールを転送されませんようお願い申し上げます。<br>===========================================================================<br><br>%%%%name%%%%様<br><br>「360度サーベイ」の回答を本日より開始致します。<br>つきましては本メールに記載のURLにアクセスのうえ、ご回答をお願い致します。<br>回答数が足りない場合、対象者の結果が出力できないことがございます。<br>お忙しいとは存じますが、201X年0月0日（水）0：00までにご回答賜りますようお願い申し上げます。<br><br>◆概要<br>本サーベイは、対象者の周囲からその人の強みや発揮している能力を指摘していただき<br>対象者にフィードバックすることで、対象者の今後の課題を明らかにし、<br>リーダーとしてより一層活躍していただくことを目的としています。<br>対象者・ご協力者共に、昇進や昇給には影響致しません。<br>皆様の率直なご意見が対象者の成長に生かされますので、是非ご協力のほどお願い致します。<br><br>◆情報の取扱いについて<br>ご記入いただきました回答内容は対象者へお知らせいたしますが、<br>回答内容が個人として特定されることはありません。<br>また、個人情報やご回答内容はあくまでも調査のためのものであり、<br>これらの情報を第三者に提供、開示することや調査目的以外で使用することはありません。<br><br>◆回答期間<br>201X年0月0日（金）～0月0日（木）0：00<br>※土日も含め24時間アクセス可能です。<br><br><br>◆回答方法<br>（１）以下のURLにアクセスして下さい。<br>%%%%URL%%%%<br><br>（２）以下のID・パスワードを入力し、マイページにログインしてください。<br>-------------------------------------------<br>あなたのID: %%%%uid%%%%<br>あなたのパスワード: %%%%pw%%%%<br>-------------------------------------------<br>★初回ログインの際にパスワードを変更して頂きます。<br>　 パスワードは必ずお手元に控えておいて頂くようにお願い致します。<br>★以前ログインされた事がある方についても、一度パスワードを初期化しております。<br>　 お手数ですが、再度パスワード変更をお願い致します。<br>ID・パスワードは半角英数字です。<br>大文字・小文字も判別されますのでお間違えのないようお願い致します。<br>なお、コピーペーストでもログイン可能です。<br><br>（３）ログインすると、あなたにご協力頂く回答のリストが表示されます。<br>それぞれのリンクをクリックし回答をお願い致します。<br>※「回答を完了する」ボタンを押さないと「回答済み」となりませんのでご注意をお願いします。<br><div><div><br>◆◆◆サーベイの内容に関するお問合せ先◆◆◆<br>株式会社●●●●<br>担当：<br>電話：<br>メール：', NULL, NULL, '', '2010-04-07 10:05:03', '2014-04-17 14:16:28', 1, 'Request for completion of 360-degree Feedback', '===========================================================================This email is being sent to subjects of 360-degree Feedback.We provide a unique URL and password for each person participating in this survey.  Please understand that you may not forward this message to anyone else.===========================================================================Mr./Mrs. %%%%name_%%%%Please access the URL link in this email and complete your responses accordingly.  Please note that if we do not get the required number of completed surveys, we will not be able to send results to the survey subject.  We kindly ask that you take some time out of your busy schedule to complete the survey questions by 0/0 <br>Mon<br>, 0pm.  ◆OverviewThe objective of this program is getting feedback from managers, peers and direct reports identifies improvement areas and strengths of ratees who are required to perform as leader. The result won''t be used to revise the salary and to evaluate ratee''s performance.◆ConfidentialityFeedback you answered will be returned to the ratees through the training.No individual raters will be identified in the reports and any information that may disclose rater''s identity will also be masked accordingly.◆DeadlineTo be completed sometime between 0/0 <br>Mon.<br> and 0/0 <br>Mon.<br> by 0pm.*You can access 24hours/7days.◆To Complete the Survey<br>1<br> Please access the below URL  %%%%URL%%%%?l=1<br>2<br> Input the below User ID and Password to login to your personal page.  -------------------------------------------Your User ID: %%%%uid%%%%Your Password: %%%%pw%%%%-------------------------------------------The User ID and Password must be input in English characters.  Please note that the server DOES discern between upper-case and lower-case letters.  You can copy and paste your User Id and Password to log in.<br>3<br> Once logged in, a list of ratees will appear on screen. Please click on the links for each ratee and respond accordingly. * Please note that if you do not push the "Finish the questionnaire" button, your responses will not be registered. <br>4<br> The survey takes approximately 30 minutes to complete. Please contact the staff members listed below with any inquiries.  ◆◆◆For inquiries about technical issues/operation of the online response system◆◆◆If you have any questions, please contact Cbase Corporation.E-mail: 360_support@cbase.co.jp◆◆◆For general inquiries about 360-degree Feedback 2011◆◆◆Human Resources Development, **** Japan Inc.,', '', '', NULL, '', NULL, '', 3, '', NULL, NULL, NULL),
(5, '未回答者へのリマインド1', '【重要】360度フィードバック　ご回答のお願い', '===========================================================================<br>このメールは、「360度サーベイ」のご協力をお願いしている方のうち、<br>現時点でご回答が全てお済みでない方に対し送信しています。<br>このメールにはあなた個人のマイページにログインするためのID及びパスワードが記載されております。<br>記載のID及びパスワードはお１人ずつ異なりますので、<br>他の方に本メールを転送されませんようお願い申し上げます。<br>===========================================================================<br><br>%%%%name%%%%様<br><br>現在ご協力をお願いしている360度サーベイについて、<br>まだ回答状態が「回答済み」となっていない回答があります。<br>つきましては下記ＵＲＬにアクセス、ログインのうえ回答状況をご確認いただき、<br>回答を完了して頂きますようお願い致します。<br>★「回答を完了する」ボタンを押さないと「回答済み」となりませんのでご注意をお願い致します。<br>★赤字で「（回答して下さい）」と表記されているリンクがないかどうか、<br>　 今一度ご確認をお願い致します。<br><br>◆回答期間<br>201X年0月0日（金）～0月0日（水）0：00<br>※土日も含め24時間アクセス可能です。<br><br><br>◆回答方法<br>（１）以下のURLにアクセスして下さい。<br>%%%%URL%%%%<br><br>（２）以下のID・パスワードを入力し、マイページにログインしてください。<br>-------------------------------------------<br>あなたのID: %%%%uid%%%%<br>あなたのパスワード:初回ログインの場合->●月●日に配信したメールに記載されています。<br>　　　　　　　　　 2回目以降のログインの場合->初回に変更したパスワードとなります。<br>-------------------------------------------<br>ID・パスワードは半角英数字です。<br>大文字・小文字も判別されますのでお間違えのないようお願い致します。<br>なお、コピーペーストでもログイン可能です。<br><br>（３）ログインすると、あなたにご協力頂く回答のリストが表示されます。<br>それぞれのリンクをクリックし回答をお願い致します。<br>※「回答を完了する」ボタンを押さないと「回答済み」となりませんのでご注意をお願いします。<br><br><br><br>ご不明な点がございましたら、以下までお問合せ下さい。<br><br><br>◆◆◆サーベイの内容に関するお問合せ先◆◆◆<br>株式会社●●●●<br>担当：<br>電話：<br>メール：', NULL, NULL, '', '2010-04-07 10:05:51', '2013-12-10 14:30:10', 1, '【Important】Feedback Response Request', '===========================================================================This email is being sent to "360-degree Feedback" respondents who have not yetcompleted their surveys.We provide a unique URL and password for each person participating in this survey.  Please understand that you may not forward this message to anyone else.===========================================================================Mr./Mrs. %%%%name_%%%%Some of your "360-degree Feedback" responses are not yet complete at this point in time.  Please access the below URL, log in, check the status of your responses and complete the survey.★Please note that if you do not push the "Finish the questionnaire" button, you responses will not be registered. ★Please check to see if there are any question links that bear the message "Unfinished" in red highlighted text. The detailed email sent previously is below for your reference.◆OverviewThe objective of this program is getting feedback from managers, peers and direct reports identifies improvement areas and strengths of ratees who are required to perform as leader. The result won''t be used to revise the salary and to evaluate ratee''s performance.◆ConfidentialityFeedback you answered will be returned to the ratees through the training.No individual raters will be identified in the reports and any information that may disclose rater''s identity will also be masked accordingly.◆DeadlineTo be completed sometime between 0/0 <br>Mon.<br> and 0/0 <br>Mon.<br> by 0pm.*You can access 24hours/7days.◆To Complete the Survey<br>1<br> Please access the below URL  %%%%URL%%%%?l=1<br>2<br> Input the below User ID and Password to login to your personal page.  -------------------------------------------Your User ID: %%%%uid%%%%Your Password: %%%%pw%%%%-------------------------------------------The User ID and Password must be input in English characters.  Please note that the server DOES discern between upper-case and lower-case letters.  You can copy and paste your User Id and Password to log in.<br>3<br> Once logged in, a list of ratees will appear on screen. Please click on the links for each ratee and respond accordingly. * Please note that if you do not push the "Finish the questionnaire" button, your responses will not be registered. <br>4<br> The survey takes approximately 30 minutes to complete. Please contact the staff members listed below with any inquiries.  ◆◆◆For inquiries about technical issues/operation of the online response system◆◆◆If you have any questions, please contact Cbase Corporation.E-mail: 360_support@cbase.co.jp◆◆◆For general inquiries about 360-degree Feedback 2011◆◆◆Human Resources Development, **** Japan Inc.,', '', '', NULL, '', NULL, '', 4, '', NULL, NULL, NULL),
(31, 'パスワード再発行', 'パスワードのご連絡', '===========================================================================<br>このメールにはあなた個人のマイページにログインするためのパスワードが記載されております。<br>記載のパスワードはお１人ずつ異なりますので、<br>他の方に本メールを転送されませんようお願い申し上げます。<br>===========================================================================<br><br>%%%%name%%%%様<br><br>ログイン用のパスワードをご連絡致します。<br>-------------------------------------------<br>あなたのパスワード: %%%%pw%%%%<br>-------------------------------------------<br>ID・パスワードは半角英数字です。<br>大文字・小文字も判別されますのでお間違えのないようお願い致します。<br>なお、コピーペーストでもログイン可能です。<br><br><br>※このメールはサーベイシステムより自動送信しております。', NULL, NULL, '', '2013-04-16 19:19:39', '2013-12-10 14:30:47', 1, '', '', '', '', NULL, '', NULL, '', 5, NULL, NULL, NULL, NULL);
