(199, 'enq_caution_', 'ユーザ', '回答シート', '', '注意書き内容', '<strong>回答時の注意事項</strong>\r\n- 回答を中断する場合は必ず「途中保存をしてメニューに戻る」ボタンをクリックしてください。\r\n- 途中保存した回答は、再度この画面を開いた際に自動的に読み込まれます。\r\n- 途中保存を行なわずにブラウザを閉じてしまいますと、新たに入力した回答は破棄されます。\r\n- 15分間この画面を開いたまま放置しますと、自動的にログアウトします。\r\n- <strong><font color=red>誤作動の恐れがありますので、複数のウインドウやタブで、回答画面を同時に開かないでください。</font></strong>', '<strong>Notes</strong>\n- To close this page before finishing the questionnaire, click the [Save and return to menu] button.\n　　　- Unsaved answers will be discarded when you close this page.\n- Saved answers will be loaded next time you open this page.\n- If you leave the page open for 15 minutes, your answers will be saved and you will be logged out automatically.\n- Answer all questions to finish the questionnaire. Do not leave any column blank.\n- Once you have finished the questionnaire, you will not be able to change your answers.\n　　　- To leave the answers changeable, do not finish the questionnaire. Use the [Save] feature instead.', '<strong>注意</strong>\n- 当中断评价时，请务必点击“中途保存并返回菜单”按钮。\n     - 如果不进行中途保存而关闭浏览器，新输入的评价内容将丢失。\n - 当您再次打开该画面时，中途保存的评价内容将被自动读入。\n - 当15分钟持续打开画面而又不进行操作时，系统将自动保存评价内容并退出。\n - 如果不答完所有评价栏，无法结束评价。\n - 评价结束后不能更改评价值。\n　　　- 如果您可能要进行更改，请不要点击“结束”按钮，而点击“中途保存”按钮进行保存。', '', NULL, ''),
