(230, 'error_2', 'ユーザ', 'エラー画面', '', '対象者を選択せずに、一括評価ボタンを押したとき', '対象者が選択されていません。\n恐れ入りますが、下記「戻る」をクリックしていただき、\n回答したい対象者にチェックをつけたのちに「チェックを入れた人を一括で回答」\nをクリックしていただきますようお願いいたします。', 'You select no ratee.\nPlease click "Return to menu" and try again.', '未选择对象人员。\n对不起，请点击下述“返回”按钮，\n并选中想要回答的对象人员，点击“对选中者进行一次性回答”。', '', NULL, ''),
(231, 'error_3', 'ユーザ', 'エラー画面', '', '6名以上同時に評価しようとしたとき', '大変申し訳ありませんが、一度に選択できる対象者は５名までです。\n恐れ入りますが、下記「戻る」をクリックしていただき、\n対象者が５名以下になるよう再度選びなおしてください。', 'Too Many Ratees.\nPlease reselect them less than 6.', '很抱歉，每次最多只能选择5个对象人员。\n对不起，请点击下述“返回”按钮，\n对象人员最多为5名，请重新选择。', '', NULL, ''),
(232, 'error_4', 'ユーザ', 'エラー画面', '', '対象者を選択せずに、一括FB閲覧ボタンを押したとき', '対象者が選択されていません。\n恐れ入りますが、下記「戻る」をクリックしていただき、\n閲覧したい対象者にチェックをつけたのちに「チェックを入れた人を一括で閲覧」\nをクリックしていただきますようお願いいたします。', 'You select no ratee.', '未选择对象人员。\n对不起，请点击下述“返回”按钮，\n并选中想要阅览的对象人员，点击“对选中者进行一次性阅览”。', '', NULL, ''),
