(234, 'backup_1', 'ユーザ', '途中保存画面', '', '途中保存完了', '途中保存しました。\n次に回答シートを開いた時には、保存した回答が自動的に読み込まれます。', 'Your answer was saved.', '中途保存完毕。\n当您下次打开回答表时，将自动读入已保存的回答内容。', '', NULL, ''),
