(239, 'timeout_1', 'ユーザ', '', '', 'タイムアウト画面メッセージ', 'ログアウトしました。\r\n回答入力ページで、一定時間操作を行なわなかったためログアウトしました。\r\n\r\n回答を再開するには、再度ログインを行なうようにお願い致します。', 'Your answer was saved and you were logged out automatically.\nClick "Return to menu" and try again.', '系统已退出。\n由于您已有一段时间未操作回答输入页面，系统已退出。\n\n回答内容已被自动保存。\n如继续进行回答，请重新登录。', '', NULL, ''),
