(248, 'mypage_infomation', 'ユーザ', 'マイページ', 'お知らせ', 'マイページのお知らせ', '<strong>360度サーベイについて</strong>\r\n本サーベイは、対象者の職務上の言動について、対象者自身と回答者に回答していただくことにより対象者に自分自身の言動を見直していただくことが目的です。\r\n本サーベイへの回答内容によって昇給・昇進等に影響が出ることはありませんので、率直にご回答ください。\r\n回答は匿名性となっており、誰がどの回答をしたかが対象者へ知らされることはありません。\r\nまた、グループ(上司・部下・同僚)それぞれ評価者を2名以上設定することにより、誰がどの回答をしたか特定できないようにしてあります。安心してご回答ください。\r\n対象者を評価する方は、直近1年以内に対象者と共に職務にあたっていたと思われる方から選定しています。\r\nもし自分はその基準に当てはまらないという方がいらっしゃいましたら、事務局までお問い合わせください。\r\n\r\n<strong>回答期間</strong>\r\n2013年00月00日(木)～2013年00月00日(木)\r\n※必ず回答期間内にご回答ください。\r\n\r\n<strong>問い合わせ先</strong>\r\nメール：360survey@ab.cd\r\n電話：0123-456-789\r\n受付時間：平日 9:30～18:00', '<strong>360度サーベイについて</strong>\r\n本サーベイは、対象者の職務上の言動について、対象者自身と回答者に回答していただくことにより対象者に自分自身の言動を見直していただくことが目的です。\r\n本サーベイへの回答内容によって昇給・昇進等に影響が出ることはありませんので、率直にご回答ください。\r\n回答は匿名性となっており、誰がどの回答をしたかが対象者へ知らされることはありません。\r\nまた、グループ(上司・部下・同僚)それぞれ評価者を2名以上設定することにより、誰がどの回答をしたか特定できないようにしてあります。安心してご回答ください。\r\n対象者を評価する方は、直近1年以内に対象者と共に職務にあたっていたと思われる方から選定しています。\r\nもし自分はその基準に当てはまらないという方がいらっしゃいましたら、事務局までお問い合わせください。\r\n\r\n<strong>回答期間</strong>\r\n2013年00月00日(木)～2013年00月00日(木)\r\n※必ず回答期間内にご回答ください。\r\n\r\n<strong>問い合わせ先</strong>\r\nメール：360survey@ab.cd\r\n電話：0123-456-789\r\n受付時間：平日 9:30～18:00', '<strong>360度サーベイについて</strong>\r\n本サーベイは、対象者の職務上の言動について、対象者自身と回答者に回答していただくことにより対象者に自分自身の言動を見直していただくことが目的です。\r\n本サーベイへの回答内容によって昇給・昇進等に影響が出ることはありませんので、率直にご回答ください。\r\n回答は匿名性となっており、誰がどの回答をしたかが対象者へ知らされることはありません。\r\nまた、グループ(上司・部下・同僚)それぞれ評価者を2名以上設定することにより、誰がどの回答をしたか特定できないようにしてあります。安心してご回答ください。\r\n対象者を評価する方は、直近1年以内に対象者と共に職務にあたっていたと思われる方から選定しています。\r\nもし自分はその基準に当てはまらないという方がいらっしゃいましたら、事務局までお問い合わせください。\r\n\r\n<strong>回答期間</strong>\r\n2013年00月00日(木)～2013年00月00日(木)\r\n※必ず回答期間内にご回答ください。\r\n\r\n<strong>問い合わせ先</strong>\r\nメール：360survey@ab.cd\r\n電話：0123-456-789\r\n受付時間：平日 9:30～18:00', '<strong>360度サーベイについて</strong>\r\n本サーベイは、対象者の職務上の言動について、対象者自身と回答者に回答していただくことにより対象者に自分自身の言動を見直していただくことが目的です。\r\n本サーベイへの回答内容によって昇給・昇進等に影響が出ることはありませんので、率直にご回答ください。\r\n回答は匿名性となっており、誰がどの回答をしたかが対象者へ知らされることはありません。\r\nまた、