(251, 'login_infomation', 'ユーザ', 'ログイン', 'お知らせ', 'ユーザログイン画面お知らせ', 'アクセスありがとうございます。\r\nご案内致しましたID・パスワードを入力し、「ログイン」ボタンを押して下さい。\r\n\r\n※ ID・パスワードは半角英数字です。\r\n※ 大文字・小文字も判別されますのでお間違えのないようお願い致します。\r\n※ なお、コピーペーストでもログイン可能です。', 'Please enter your UserID and Password in the email you received.\n\n※ UserID/Password is case-sensitive.\n※ You can also copy and paste.', '衷心感谢您的访问。\n请输入邮件通知的ID和密码，按下“登录”按钮。\n\n※ID和密码使用半角英文字母和数字。\n※区分大小写，请不要弄错。\n※也可通过复制和粘贴登录。', '', NULL, ''),
