(380, 'user_relation_view_message_1', 'ユーザ', '回答者情報閲覧', '文言', '回答者の選定　説明文', '他者は合計5名以上になるように選定して下さい。\nまた、上司は1名以上、部下・同僚はそれぞれ2名以上を選択して頂くことを推奨しています。', 'Please select 5 raters at least.\nWe recommend selecting a superior, 2 or more subordinates, 2 or more peers.', '其他人员请选择合计5名以上。\n此外，我们推荐上司选择1名以上，部下和同事各选择2名以上。', '', NULL, ''),
(381, 'setup_reply_user_message_1', 'ユーザ', '承認者選定検索', '文言', '承認者選定検索　注意書き', '＜注意＞承認依頼は直属上司 1 名を選択して送信してください。', 'Please select your immediate boss.', '<注意>请选择1名直属上司发送批准请求文件。', '', NULL, ''),
