(385, 'user_relation_view_message_2', 'ユーザ', '回答者情報閲覧', '文言', '承認者の選択　説明文', '回答者の追加や変更がある場合は、「回答者の追加 / 変更」ボタンを押して、指名を続けて下さい。\n回答者を指名したら、下の「回答者を確定する」ボタンを押して回答者の指名を完了して下さい。', 'Your rater list is subject to approval by your direct boss. Please send email to request for approval.\r\n\r\n<!--If you''d like to select more raters, please click "Add / Edit" button.\r\n\r\nAfter you selected, please click "Confirm Raters" button.-->', '发送批准请求邮件。\n\n<!--如果要增加或变更回答人，请按【回答人的增加/变更】按钮，继续选择。\n\n选择好全部回答人后，请按下以下按钮，发送回答人批准请求邮件。-->', '', NULL, ''),
