(540, 'user_relation_view_message_5', 'ユーザ', '回答者選定', '文言', '回答者確定', '回答者の選定を完了しました。ご協力ありがとうございました。', 'Your list is accepted. Thank you for your cooperation.', '您已完成回答人选择，谢谢合作。', '', NULL, ''),
(542, 'mypage_name_', '全体', '', '文言', 'ローマ字', 'ローマ字', 'Name(EN)', '罗马字母', '', NULL, ''),
(543, 'news_body', 'ユーザ', 'お知らせ画面', 'メッセージ', 'お知らせ本文', '本画面は初めてログインされた方のみに表示されます。\n次回以降表示したくない場合は、下記より「次回表示しない」を選んでください。\n\n<strong>概要</strong>\n本サーベイは、対象者の周囲からその人の強みや発揮している能力を指摘してもらい対象者にフィードバックすることで、\n対象者の今後の課題を明らかにし、リーダーとしてより一層活躍して頂くことを目的としています。\n対象者・ご協力者共に、昇進や昇給には影響致しません。\n皆様の率直なご意見が対象者の成長に生かされますので、是非ご協力のほどお願い致します。\n\n\n<strong>回答期間</strong>\nx月x日（）～x月x日（）xx：xx\n※土日も含め24時間アクセス可能です。\n\n◆◆◆サーベイの内容に関するお問合せ先◆◆◆\n株式会社サンプル\n人事・総務部　abcde@xxxx.yy.zz', '', '本画面仅限为首次登录者时显示。\n下次不想再显示时，请选择“下次不再显示”。\n\n<strong>◆概要</strong>\n本调查的目的在于让对象人员周围的人指出其优点及发挥出的能力，并反馈给对象人员，\n明确对象人员今后应解决的问题，以期在领导岗位上进一步发挥才能。\n我们不会将本调查的结果用于对象人员和协助回答的人员的人事考评。\n各位率直的意见将被充分利用于对象人员进步，请您务必给予大力支持。\n\n<strong>◆关于信息的使用</strong>\n我们将把您填写的回答内容通过反馈研修的形式发给对象人员。\n届时，不会从回答内容中识别出回答者个人的身份。\n此外，个人信息和回答内容终究只用于调查，\n我们不会将这些信息提供和出示给第三方，也不会用于调查之外的目的。\n\n<strong>◆回答期限</strong>\nXXXX年XX月XX日～XX月XX日\n※包括周六及周日均可24小时访问。\n\n\n◆◆◆调查内容咨询部门◆◆◆\n\n株式会社XX\n担当：人事部  XX\n电话：　111-1111\n电子邮箱：XXX@XXX.co.jp', '', NULL, ''),
(544, 'enq_error_over', 'ユーザ', '回答シート', '', '', 'の選択数が超過しております。', 'Too Many Choices', '的选择数量超过了。', '', NULL, ''),
