(566, 'enq_caution2', '回答画面', '', '', '注意書き', 'このサーベイ（調査）は、対象について皆さんが日頃感じていることを統計的にまとめ、職場をより良くするための資料とするものです。<br />\n各質問に思うところを率直にご回答ください。', 'This survey is designed to statistically summarize what you think about the "survey subject" on a daily basis, with the aim of creating a better workplace.<br />\nPlease express your opinions as candidly as possible.', '本次调查将把大家对调查对象的日常感受进行统计汇总，使之成为有助于改善职场环境的资料。<br />对各项提问，请如实回答自己的想法。', '', NULL, ''),
(567, 'errortext', '回答画面', '文字数超過のエラー', '文字数超過のエラー', '文字数超過のエラー', '入力できる文字数は500文字までです。', 'You can write up to 500 characters.', '最多填写500字。', '', NULL, ''),
