(589, 'pw_reissue_info', 'ユーザ', 'パスワード再設定', 'お知らせ', 'ユーザパスワード再設定画面お知らせ', '<span style="font-size:18px"><b>◆パスワード変更（初回ログイン時のみ）</b></span>\r\n\r\n<span>セキュリティ強化のため初回ログイン時のみ、任意のパスワードへ変更をお願い致します。\r\n（変更後は、この画面は表示されません）</span>\r\n\r\n新しいパスワードを上下2箇所のエリアに入力後、「再設定」ボタンを押してください。\r\n（入力する文字列は<b><font color="red">上下ともに同じ</font></b>となります）\r\n\r\nなおパスワードは<b><font color="red">英数字まじりの半角6桁以上</font></b>で設定してください。', '<span style="font-size:16px">Change password</span>\r\n\r\n\r\nPlease enter a new password and press the "Reset" button.\r\nSpecify the password by using <b>8</b> or more <b>alphanumeric characters</b>.', '', '', '', ''),
