(603, 'send_password_info', 'ユーザ', '', '', '', 'パスワードを再発行致します。\nあなたのIDとメールアドレスを入力し、「再発行」ボタンを押してください。\n入力したメールアドレス宛にパスワードを送信いたします。\n<span style="color:red;">IDは事務局より届いたメールに記載されています。</span>\n<span style="color:red;">メールアドレスは、事務局から本案内が届いたメールアドレスを入力してください。（それ以外のメールアドレスには対応していません)</span>', 'This page is for those who forget their password.\nPlease enter your ID and email address, and press the "Reissue" button.\nYour password will be sent to the email address you entered.\n<span style="color:red;">Your ID will be shown in the email you receive from the head office.</span>\n<span style="color:red;">Please enter the email address you received this information by the head office. (Other email addresses are unacceptable.)</span>', NULL, NULL, NULL, ''),
