(606, 'confirm_incorrect', '', '', '', '', '「新しいパスワード」と「新しいパスワード(確認用)」とが一致していません。\n確認・修正のうえ「再設定」ボタンを押してください。', 'The "master password" and "confirmation password" do not match. Check and correct them properly, and then press the "Reset" button.', NULL, NULL, NULL, ''),
(607, 'failed_to_update', 'ユーザ', '', '', '', '更新に失敗しました。', 'Update failed.', NULL, NULL, NULL, ''),
(608, 'register_complete_message', 'ユーザ', '', '', '登録完了しました。', '<span style="color:red;size:13px;font-weight:bold">登録しました</span>\n<br/>\n<br/>\n●続けて新規登録する場合、下記ボタンから回答者情報一覧に戻り、「回答者の追加」ボタンを押してください。<br />\n●回答者設定を完了する場合、下記ボタンから回答者情報一覧に戻り、必ず「回答者の確定」ボタンを押してください。<br />', '<span style="color:red;size:13px;font-weight:bold">Registered</span>\n<br/>\n<br/>\n● To register another rater, please return to your rater list by pressing the button shown below and press the "Add raters" button.<br />\n● To complete your rater list, please return to it by pressing the button shown below and press the "Confirm" button.<br />', NULL, NULL, NULL, ''),
