(631, 'respondent_edit_message', 'ユーザ', '回答者選定', '', '', '<div style="margin-bottom:20px;background-color:#f0f0f0;padding:10px">\n<div style="font-weight:bold;font-size:17px;background-color:#ffffff;margin:10px 0px;padding:5px;text-align:left;border-bottom:solid 3px #333399">[ 1 ]協力者の選定</div>\n<div style="margin:auto;width:800px;text-align:left">\n\n<pre>あなたの協力者（上司、同僚、部下）を選定し、必要事項を入力・選択して「確認」ボタンを押してください。\n\n評価協力者は、可能な限り多くの方を選定してください（5名～ 10名程度）。\n協力者の数が多ければ多いほど、より有益な気づきが得られます。\n</pre>\n\n</div>\n</div>', '<div style="margin-bottom:20px;background-color:#f0f0f0;padding:10px">\n<div style="font-weight:bold;font-size:17px;background-color:#ffffff;margin:10px 0px;padding:5px;text-align:left;border-bottom:solid 3px #333399">[ 1 ]協力者の選定</div>\n<div style="margin:auto;width:800px;text-align:left">\n\n<pre>あなたの協力者（上司、同僚、部下）を選定し、必要事項を入力・選択して「確認」ボタンを押してください。\n\n評価協力者は、可能な限り多くの方を選定してください（5名～ 10名程度）。\n協力者の数が多ければ多いほど、より有益な気づきが得られます。\n</pre>\n\n</div>\n</div>', '<div style="margin-bottom:20px;background-color:#f0f0f0;padding:10px">\n<div style="font-weight:bold;font-size:17px;background-color:#ffffff;margin:10px 0px;padding:5px;text-align:left;border-bottom:solid 3px #333399">[ 1 ]協力者の選定</div>\n<div style="margin:auto;width:800px;text-align:left">\n\n<pre>あなたの協力者（上司、同僚、部下）を選定し、必要事項を入力・選択して「確認」ボタンを押してください。\n\n評価協力者は、可能な限り多くの方を選定してください（5名～ 10名程度）。\n協力者の数が多ければ多いほど、より有益な気づきが得られます。\n</pre>\n\n</div>\n</div>', '', '', ''),
